import React from 'react';
import './App.css';

function App() {
  const element = "Office Space";
  const offices = [
  {
    Name: "DBS",
    Rent: 50000,
    Address: "Chennai",
    Image: "data:image/jpeg;base64,"
  },
  {
    Name: "EcoTower",
    Rent: 45000,
    Address: "Pune",
    Image: "data:image/jpeg;base64,"
  },
  {
    Name: "BizHub",
    Rent: 65000,
    Address: "Bangalore",
    Image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZPFv3KqBOfVxnr2C_vVoqNMMlLYgM_DUcgA&s"
  },
  {
    Name: "TechSpace",
    Rent: 60000,
    Address: "Delhi",
    Image: "https://images.unsplash.com/photo-1509395176047-4a66953fd231?auto=format&fit=crop&w=600&q=60"
  }
];


  return (
    <div className="App">
      <h1>{element}, at Affordable Range</h1>
      {offices.map((office) => {
        let colors = [];
        if (office.Rent <= 60000) {
          colors.push('textRed');
        } else {
          colors.push('textGreen');
        }

        return (
          <div className="office-card">
            <img className='img' src={office.Image} alt={office.Name} />
            <h2>Name: {office.Name}</h2>
            <h3 className={colors.join(' ')}>Rent: Rs. {office.Rent}</h3>
            <h4>Address: {office.Address}</h4>
            <hr />
          </div>
        );
      })}
    </div>
  );
}

export default App;
